import React from "react";
import { Timeline } from "react-twitter-widgets";

function Social() {
  return (
    <div className="social">
      <div>
        <main>
          <Timeline
            dataSource={{
              sourceType: "profile",
              screenName: "PolymathNYC",
            }}
            options={{
              height: "500",
            }}
          />
        </main>
      </div>
    </div>
  );
}

export default Social;
